import React, { useState } from "react";
import axios from "axios";

export default function PostProject() {
  const [formData, setFormData] = useState({
    title: "",
    description: "",
    minBudget: "",
    maxBudget: "",
    deadline: "",
    skills: "",
  });
  const [message, setMessage] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const token = localStorage.getItem("token");
    const clientId = Number(localStorage.getItem("userId"));

    if (!token) return setMessage("You are not logged in!");
    if (!clientId) return setMessage("User ID not found!");

    const projectData = {
      ...formData,
      clientId,
      minBudget: Number(formData.minBudget),
      maxBudget: Number(formData.maxBudget),
      skills: formData.skills.split(",").map((s) => s.trim()),
      deadline: new Date(formData.deadline).toISOString(),
    };

    try {
      await axios.post("http://localhost:8080/projects", projectData, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setMessage("Project posted successfully!");
      setFormData({ title: "", description: "", minBudget: "", maxBudget: "", deadline: "", skills: "" });
    } catch (error) {
      console.error(error.response?.data || error.message);
      setMessage("Error posting project. Check console for details.");
    }
  };

  return (
    <div style={{
      padding: "40px 20px",
      maxWidth: "600px",
      margin: "50px auto",
      fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
    }}>
      <div style={{
        background: "linear-gradient(145deg, #eef2f7, #dbe6f2)",
        padding: "30px",
        borderRadius: "15px",
        boxShadow: "inset 0 2px 6px rgba(0,0,0,0.05), 0 6px 20px rgba(0,0,0,0.1)",
        border: "1px solid #cbd5e0",
        transition: "all 0.3s ease",
      }}>
        <h2 style={{ textAlign: "center", marginBottom: "20px", color: "#1f2937" }}>Post a New Project</h2>

        {message && (
          <p style={{
            textAlign: "center",
            color: message.includes("successfully") ? "#16a34a" : "#dc2626",
            marginBottom: "20px",
            fontWeight: "500"
          }}>
            {message}
          </p>
        )}

        <form onSubmit={handleSubmit} style={{ display: "flex", flexDirection: "column", gap: "15px" }}>
          <input
            type="text"
            name="title"
            placeholder="Project Title"
            value={formData.title}
            onChange={handleChange}
            required
            style={{ padding: "12px", borderRadius: "8px", border: "1px solid #cbd5e0", fontSize: "15px" }}
          />
          <textarea
            name="description"
            placeholder="Project Description"
            value={formData.description}
            onChange={handleChange}
            required
            style={{ padding: "12px", borderRadius: "8px", border: "1px solid #cbd5e0", fontSize: "15px", minHeight: "100px" }}
          />
          <div style={{ display: "flex", gap: "10px" }}>
            <input
              type="number"
              name="minBudget"
              placeholder="Minimum Budget"
              value={formData.minBudget}
              onChange={handleChange}
              required
              style={{ flex: 1, padding: "12px", borderRadius: "8px", border: "1px solid #cbd5e0", fontSize: "15px" }}
            />
            <input
              type="number"
              name="maxBudget"
              placeholder="Maximum Budget"
              value={formData.maxBudget}
              onChange={handleChange}
              required
              style={{ flex: 1, padding: "12px", borderRadius: "8px", border: "1px solid #cbd5e0", fontSize: "15px" }}
            />
          </div>
          <input
            type="date"
            name="deadline"
            value={formData.deadline}
            onChange={handleChange}
            required
            style={{ padding: "12px", borderRadius: "8px", border: "1px solid #cbd5e0", fontSize: "15px" }}
          />
          <input
            type="text"
            name="skills"
            placeholder="Skills (comma separated)"
            value={formData.skills}
            onChange={handleChange}
            required
            style={{ padding: "12px", borderRadius: "8px", border: "1px solid #cbd5e0", fontSize: "15px" }}
          />

          <button
            type="submit"
            style={{
              padding: "14px",
              borderRadius: "10px",
              border: "none",
              background: "linear-gradient(90deg, #4ade80, #22c55e)",
              color: "#fff",
              fontSize: "16px",
              cursor: "pointer",
              fontWeight: "600",
              transition: "all 0.3s",
            }}
            onMouseOver={(e) =>
              Object.assign(e.currentTarget.style, {
                background: "linear-gradient(90deg, #22c55e, #16a34a)",
                transform: "scale(1.02)",
              })
            }
            onMouseOut={(e) =>
              Object.assign(e.currentTarget.style, {
                background: "linear-gradient(90deg, #4ade80, #22c55e)",
                transform: "scale(1)",
              })
            }
          >
            Post Project
          </button>
        </form>
      </div>
    </div>
  );
}
